A BRAND-NEW PROGRAMME TO KCL RADIO! 

Just 2 girls with personalities from opposite ends of the spectrum trying to navigate life in our 20s. We’ll be discussing the ins and outs of topics from religious beliefs and its relationship with spirituality, to our personal but very relatable dilemmas. Whether you’re rotting away or need company during your hot girl walk, tune in! 💟 🌟

@oppositesattractpd is hosted by @joshini.s and @julia_shicx.

