Let me dig into the water of the thick and dirty Thames, I want to see the thoughts that leak on the paper from your pen. Second year of observing the water and still it merely starts to reveal, the surface of my changing mind from politics to neurosci. Away from the neutral air of home I write to care, like Lamartine ravaged by the tuberculosis he didn’t have, and he cried when Julie died, in Isolation he was tried. In the thick and misty air, let me edit the words you pair, and let all our verses trickle down on the Thames’ sombre gown.

