We are thrilled to announce our finalists for the EBC 2024 startup pitch competition!

This time some of the brightest rising founders pitch in front of a judge panel consisting of VC experts and seasoned entrepreneurs for a chance to win a £5,000 prize, fast-track into ULTRA.VC and more!

Our Startups: 

@flexup.app - AI powered, on-demand staffing platform for Hospitality & Retail industries

FUSS APP - redefining city leisure exploration with personalised suggestions of worth-the-fuss experiences 

Convey Guru - AI-driven Smart Assistant for Legal Professionals

Malevich AI - workspace for building AI backends

@boxxdocks - AI-enabled track & trace platform, mapping supply chains while reducing costs and carbon emissions within the logistics sector

@wellexpert.health - telehealth platform specialising in the gut-skin-mind connectio

Niya - Career Management Platform helping the world’s most unconnected people transition into new careers

@jupitrr.ai - AI Video Maker that helps content creators make videos 10X faster by automating video editing

Our judges: Alexander Konoplyasty (Flashpoint Venture Capital), Vlad Tropko (Launchbay Capital), Elif Sancak (VC Scout, mentor @Techstars), Nurdaulet Bazylbekov (Angel investor & VC Scout), Anthony Rose (SeedLegals), Dmitry Grishin (Grishin Robotics), Konstantin Gnyp (Runa Capital)

Together with @emergeconfhq we are bringing the best networking and fundraising opportunities for founders. See you on March 2nd!

