Hi everyone, we are thrilled to announce our next beehives visit this summer, on the 8th floor of Connaught Roof at LSE! Join us next Tuesday, 11th July at 3 PM BST! Discover the vital role bees play in our ecosystem and connect with like-minded individuals. 🍯🌿We just split the bees this June to create new colonies, so it would be an interesting visit! 🐝💚Don't miss out—register now for an unforgettable experience! Due to limited spaces, pls fill up the sign-up form by the end of this week: https://forms.gle/cHRDohdY4AJK5D5D6

